import React from 'react';
import logo from './logo.svg';
import './App.css';

const letters = ["", "A", "B", "C", "D", "E", "F", "G", "H", ""];
const numbers = ["1", "2", "3", "4", "5", "6", "7", "8"];

function Board(Rows) {
  return class extends React.Component {
    render() {
      return (
        <section className="container border border-5">

          <Rows {...this.props}/>
        </section>
      )
    }
  }
}

function App() {
  let rows = [];

  for (let i = 1; i <= 64; i++) {
    if (i % 8 === 0) {
      rows.push(
        <div className="row">
          <div className="col square"> {i} </div>
        </div>
      )
    }
  }

  console.log(rows)
}

export default App;
